.overflowingText {
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
  display: block;
}
.sankeyDiagram {
  font-family: helvetica, arial, sans-serif;
  font-size: 11px;
}
.sankeyDiagram .nodes .node .nodeRect {
  stroke-width: 1px;
  fill-opacity: 0.9;
  shape-rendering: crispEdges;
}
.sankeyDiagram .nodes .node .nodeLabel {
  font-size: 11px;
}
.sankeyDiagram .nodes .node.selected {
  opacity: 0.3;
}
.sankeyDiagram .links .link {
  fill: none;
  stroke-opacity: 0.2;
  fill-opacity: 0.2;
  stroke-width: 1;
}
.sankeyDiagram .links .link:hover,
.sankeyDiagram .links .link.selected {
  stroke-opacity: 0.7;
  fill-opacity: 0.7;
  stroke-width: 1;
}


